translated_text:
Ilocano: Ti saan a pagsayaatan ti lente ti zoom ket ti kumplikado a pokusna ken ti kinaadu ti elemento iti lentena a kasapulan tapno maala ti sakup ti kinaatiddog ti pokus ket ad-adu ngem para kadagiti primo a lente. 
English:
I want to zoom in and out, but I can't do that because I have to zoom in and out on the same element. How can I do that?

A:

You can use the following code to zoom in and out on the same element:
$('#zoom').bind('zoomingIn', function() {
    $('#zoom').css('z-index', '100');
});
$('#zoom').bind

